import styled from 'styled-components';

export const NavBar = styled.nav`
  height: 72px;
  width: 100%;
  /* max-width: 1160px; */

  background: #fff;

  align-items: center;

  .navbar {
    padding: 0 140px;
    margin: 0 auto;
    display: flex;
    justify-content: space-between;
    font-size: 18px;
    background: red;
  }
  .navbar-items {
    display: flex;
    font-size: 18px;
  }
`;
